import React from 'react';

function Header(){
    const headerStyle = {
        height: '50px',
        width: '100%',
        backgroundColor: 'orange'
    }
    const buttonStyle = {
        float : 'right'
    }
    return(
        <div style={headerStyle}>
            <div>
                <button style={buttonStyle}>Log in</button>
            </div>
        </div>
    )
}

export default Header;
